import React from "react";
import { Link, withRouter } from "react-router-dom";
function Home(props) {
  return (
    <div className="buttonbox">
      <Link to="/login" className="button">
        Log In
      </Link>
      <div className="button"> Create account </div>
    </div>
  );
}

export default Home;
